import React from "react";

const services = [
  { name: "Online Consultation", description: "Talk to a doctor from anywhere." },
  { name: "Appointment Booking", description: "Book appointments hassle-free." },
  { name: "E-Prescriptions", description: "Get digital prescriptions instantly." },
];

const Services = () => {
  return (
    <section className="p-12 bg-gray-100 text-center">
      <h2 className="text-3xl font-bold text-gray-800">Our Services</h2>
      <div className="mt-8 grid grid-cols-1 md:grid-cols-3 gap-8">
        {services.map((service, index) => (
          <div key={index} className="p-6 bg-white rounded-lg shadow-lg">
            <h3 className="text-xl font-bold">{service.name}</h3>
            <p className="text-gray-600 mt-2">{service.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Services;
